import axios from "axios";


const ProfileItem = () => {
    axios({
        method: "GET",
        url: "http://localhost:8000/api/list-user",
        data: null,
        }).then(res => {
            console.log(res.data);
        }).catch(err => {
            console.log(err);
        });
  return (
    
      <tr>
        <td>1</td>
        <td>Thìn</td>
        <td>admin</td>
        <td>admin@admin.com</td>
        <td>0123456789</td>

        <td>
          <button type="button" class="btn btn-danger mr-10">
            Xoá
          </button>

          <button type="button" className="btn btn-success">
            Update
          </button>
        </td>
      </tr>
    
  );
};

export default ProfileItem;
